function a = print_NMF(filename, Fs) load(filename);absc = zeros([size(coefs(1,:))]);for i=1:length(absc)  absc(i)=(i*delta)/Fs;end;figure;ax1 = subplot(2,1,1);ax2 = subplot(2,1,2);for i=1:length(coefs(1,:))for j=1:4if coefs(j,i)>= 9e+15coefs(j,i) = 9e+15;end;end;end;plot(ax1, absc, coefs(1,:), absc, coefs(2,:), absc, coefs(3,:), absc, coefs(4,:));title(ax1, "Evolution de la presence de chaque instrument");plot(ax2, absc, compteurs);title(ax2,"nombre de boucle pour l optimisation");a = 0;return;end